        public void GerarNotaFiscal(string filePath)
        {
            // Criação do documento
            Document document = new Document();
            PdfWriter writer = PdfWriter.GetInstance(document, new FileStream(filePath, FileMode.Create));

            document.Open();

            // Configurações da borda
            PdfContentByte canvas = writer.DirectContent;
            canvas.SetLineWidth(1f);
            canvas.SetRGBColorStroke(0, 0, 0); // Cor da borda (preto)
            canvas.SetLineDash(1f, 0f); // Estilo da linha (linha sólida)
            canvas.SetLineCap(PdfContentByte.LINE_CAP_PROJECTING_SQUARE);

            //// Criação do retângulo
            //float x = 25f;
            //float y = document.PageSize.Height - 800f;
            //float width = document.PageSize.Width - 50f;
            //float height = 800f;

            //canvas.Rectangle(x, y, width, height);
            //canvas.Stroke();

            // Obtém a altura da página
            float alturaPagina = document.PageSize.Height;

            // Define o afastamento da borda superior e inferior
            float margemVertical = 50f;

            // Calcula a posição y do retângulo
            float alturaRetangulo = 770f; // Altura do retângulo
            float y = alturaPagina - margemVertical - alturaRetangulo;

            // Criação do retângulo
            float x = 25f;
            float width = document.PageSize.Width - 50f;
            float height = 800f;

            canvas.Rectangle(x, y, width, height);
            canvas.Stroke();


            // Adição de conteúdo à nota fiscal
            Font fontTitulo = FontFactory.GetFont(FontFactory.HELVETICA_BOLD, 16);
            Font fontTexto = FontFactory.GetFont(FontFactory.HELVETICA, 12);

            Paragraph titulo = new Paragraph("NOTA FISCAL", fontTitulo);
            titulo.Alignment = Element.ALIGN_CENTER;

            Paragraph empresa = new Paragraph("Nome da Empresa", fontTexto);
            Paragraph endereco = new Paragraph("Endereço da Empresa", fontTexto);
            Paragraph cidade = new Paragraph("Cidade, Estado, CEP", fontTexto);

            PdfPTable tabelaItens = new PdfPTable(3); // Tabela com 3 colunas
            tabelaItens.WidthPercentage = 100;
            tabelaItens.SetWidths(new float[] { 2f, 5f, 2f }); // Define a largura das colunas

            PdfPCell cabecalho1 = new PdfPCell(new Phrase("Item", fontTexto));
            cabecalho1.HorizontalAlignment = PdfPCell.ALIGN_CENTER;

            PdfPCell cabecalho2 = new PdfPCell(new Phrase("Descrição", fontTexto));
            cabecalho2.HorizontalAlignment = PdfPCell.ALIGN_CENTER;

            PdfPCell cabecalho3 = new PdfPCell(new Phrase("Quantidade", fontTexto));
            cabecalho3.HorizontalAlignment = PdfPCell.ALIGN_CENTER;

            tabelaItens.AddCell(cabecalho1);
            tabelaItens.AddCell(cabecalho2);
            tabelaItens.AddCell(cabecalho3);

            // Adicionar linhas de itens simulados
            for (int i = 1; i <= 10; i++)
            {
                PdfPCell cell1 = new PdfPCell(new Phrase(i.ToString(), fontTexto));
                cell1.HorizontalAlignment = PdfPCell.ALIGN_CENTER;

                PdfPCell cell2 = new PdfPCell(new Phrase("Descrição do Item " + i, fontTexto));

                PdfPCell cell3 = new PdfPCell(new Phrase("1", fontTexto));
                cell3.HorizontalAlignment = PdfPCell.ALIGN_CENTER;

                tabelaItens.AddCell(cell1);
                tabelaItens.AddCell(cell2);
                tabelaItens.AddCell(cell3);
            }

            // Adicionar informações do total
            Paragraph total = new Paragraph("Total: R$ 1000,00", fontTexto);
            total.Alignment = Element.ALIGN_RIGHT;

            // Adicionar informações do rodapé
            Paragraph rodape = new Paragraph("Informações adicionais do rodapé", fontTexto);
            rodape.Alignment = Element.ALIGN_CENTER;

            document.Add(titulo);
            document.Add(empresa);
            document.Add(endereco);
            document.Add(cidade);
            document.Add(new Paragraph(Environment.NewLine)); // Adiciona uma linha em branco
            document.Add(tabelaItens);
            document.Add(new Paragraph(Environment.NewLine)); // Adiciona uma linha em branco
            document.Add(total);
            document.Add(new Paragraph(Environment.NewLine)); // Adiciona uma linha em branco
            document.Add(rodape);

            document.Close();
            writer.Close();
        }

       

    }
}
